from typing import List
from collections import defaultdict


class Solution:
    def maxSum(self, nums1: List[int], nums2: List[int]) -> int:
        """
        Alex Wice's Solution
        """

        MOD = 10 ** 9 + 7

        # dp_nums1[i]: the max score you can get starting from nums1[i]
        # the dp_nums1[len(nums1)] is just for the edge case (initial value 0)
        dp_nums1 = [0] * (len(nums1) + 1)
        dp_nums2 = [0] * (len(nums2) + 1)

        i = len(nums1) - 1
        j = len(nums2) - 1
        while i >= 0 and j >= 0:
            if nums1[i] > nums2[j]:
                # keep going along nums1
                dp_nums1[i] = nums1[i] + dp_nums1[i + 1]
                i -= 1
            elif nums1[i] < nums2[j]:
                # keep gling along nums2
                dp_nums2[j] = nums2[j] + dp_nums2[j + 1]
                j -= 1
            else:
                # step on the same number => go to the larger one
                dp_nums1[i] = dp_nums2[j] = nums1[i] + max(dp_nums1[i + 1], dp_nums2[j + 1])
                i -= 1
                j -= 1

        # keep going till the end (if running out of i or j)
        while i >= 0:
            dp_nums1[i] = nums1[i] + dp_nums1[i + 1]
            i -= 1
        while j >= 0:
            dp_nums2[j] = nums2[j] + dp_nums2[j + 1]
            j -= 1

        return max(dp_nums1[0], dp_nums2[0]) % MOD

